{
  "application": "Magpie",
  "software_requirements": [
    {
      "name": "Java",
      "version": "1.8.0",
      "path": "/usr/lib/jvm/jre-1.8.0/"
    },
    {
      "name": "Python",
      "version": "3",
      "path": "/usr/bin/python3"
    },
    {
      "name": "Hadoop",
      "version": "3.3.6",
      "path": "${HOME}/hadoop-${HADOOP_VERSION}",
      "setup": "yes",
      "type": "MR",
      "filesystem_mode": "hdfsoverlustre"
    },
    {
      "name": "Spark",
      "version": "3.5.0-bin-hadoop3",
      "path": "${HOME}/spark-${SPARK_VERSION}",
      "setup": "yes",
      "type": "YARN"
    }
  ],
  "resource_requirements": {
    "node_count": "defined by PBS -l nodes=<my_node_count>",
    "partition": "defined by PBS -l partition=<my_partition>",
    "queue": "defined by PBS -q <my_batch_queue>",
    "walltime": "defined by PBS -l walltime=<my_time_in_seconds_or_HH:MM:SS>",
    "account": "defined by PBS -A <my_account_string>"
  },
  "job_type": "spark",
  "job_name": "defined by PBS -N <my_job_name>"
}
